import React from "react";

function Contact() {
  return (
    <section id="contact" className="py-20 px-[10%] bg-[#0f0f0f] text-center">
      <h2 className="text-4xl text-[#ffcc70] text-center mb-10">Contact Us</h2>
      <p className="text-gray-300">Feel free to reach out to us!</p>
    </section>
  );
}

export default Contact;
